import Tooltip from "react-simple-tooltip";
import logo from '../assets/images/logo5.png';
import { BrowserRouter, Link, Route } from 'react-router-dom';
// import Page from './Page.js';
import '../assets/css/App.css';
import Show from './Show.js';

export default class Header extends React.Component {
    render() {
        return (
        <BrowserRouter>
            <div>
                <nav className="navbar navbar-inverse navbar-light fixed-top" id="mainNav">
                    <h1 class="logo">fusséeline</h1>
                    <ul class="navbar-nav">
                        <li class="nav-item">
                            <Tooltip content="fusséeline" placement="bottom" background="#7c7c7c">
                                <Link to="" ><img src={logo} widht="100" height="50" 
                                className="d-inline-block align-top" alt="profil" /></Link>
                            </Tooltip>
                        </li>
                        <li class="nav-item">
                        <Tooltip content="Login/Register" placement="bottom" background="rgb(53, 56, 47)" border="#000" color="#fff">
                        <button><a class="nav-link" href="#"><img src={Profil} widht="100" height="50" alt="profil"/></a></button>
                        </Tooltip>
                        </li>
                        <li class="nav-item">
                        <Tooltip content="Info" placement="bottom" background="rgb(53, 56, 47)" color="#FFF">
                             <a class="nav-link" href="#"><img src={Infos} widht="100" height="50" alt="infos"/></a>
                        </Tooltip>
                        </li>
                    </ul>
                </nav>
                <div className="main-route-place">
                    <Route exact path="/pag/" component={Page} />
                    <Route exact path="/post/:id" component={Show} />
                </div>
            </div>
        </BrowserRouter>
        );
    }
}
